import React from "react";
import { Form, Input, Button } from "antd";
import "antd/dist/antd.css";
const Index = (props) => {
  return (
    <div className="container">
      <Form>
        <Form.Item label="Username" name="Username">
          <Input />
        </Form.Item>
      </Form>
    </div>
  );
};
export default Index;
